import { Navbar } from "./Navbar";
import { AllComponents } from "./ComponentContainer";
import { Board } from "./Board";
import { Link, Route, Routes } from "react-router-dom";

function App() {
  return (
    <main>
      {/* <Link to="/boards">Home</Link> */}

      <Navbar />
      <Routes>
        <Route path="/boards" element={<Board />}></Route>
      </Routes>
      <AllComponents />
    </main>
  );
}

export default App;
